import React, { Component } from 'react';
import Header from "../../common/header/Header";
//import './Details.css';

class Details extends Component {
    constructor() {
        super();
    }

    render(){
        return(
            <div className="details">
                 <Header baseUrl={this.props.baseUrl} showBookShowButton="true"/>
            </div>    
        );
    }

}
